"use strict";const webuiAppConfig=(()=>{const appConfig={};return webui.define("webui-app-config",{attr:["src"],connected:t=>{for(const attr of t.attributes)-1===["src"].indexOf(attr.name)&&(appConfig[attr.name]=attr.value,webui.setData(attr.name,attr.value));t.src&&fetch(t.src).then((result=>result.json())).then((data=>{Object.keys(data).forEach((key=>{appConfig[key]=data[key],webui.setData(key,data[key])}))})).catch((err=>{console.error("Failed loading app config from src",err)}))}}),appConfig})();